The microstructures of as-deposited and aged samples are exhibited in Fig. 2
                        . The images of the specimens were obtained at the cross-section perpendicular to the building direction. As-deposited sample and 600 °C aged samples (Fig. 2a and b) exhibit similar near single BCC solid solution phase structure. Fig. 3
                         shows the EBSD phase map of 600 °C heat treated sample. In the phase map, red and blue areas indicate the B2/BCC and FCC phases respectively. There is only approximate 2% volume fraction of FCC phase sitting at grain boundaries. Periodic, fine scale structures consisting of alternating bright and dark interconnected phases appear inside grains for both conditions (Fig. 2f and g). These two interconnected phases in 600 °C heat treated sample were investigated by TEM analysis (Fig. 4
                        ). SADPs picked from matrix and precipitate phases have exactly the same B2 diffraction pattern, which confirms that both of them are B2 solid solution phases. These two phases are assumed to be conjugate B2 phases formed by spinodal decomposition, which differ in composition but have the same crystal structure. The composition difference is demonstrated by three dimensional atom probe tomography of as-deposited specimen (Fig. 5
                        ). The segregation of Ni, Al and Cr is extreme. The dark phase is rich in Al and Ni with homogeneous distribution, while the bright phase is rich in Cr. The distribution of Cr is not homogeneous neither in bright phase nor in dark phase, forming clusters of spiral shape and plate shape respectively. Although Fe and Co is distributed more homogeneously compared with the other three elements, it is still evident the bright phase has a higher concentration of these elements than the dark phase.
